import React from "react";
import { Icon, Form, Button, Row, Col, Input, Card } from 'antd';
import axios from 'axios';
import swal from 'sweetalert';

class ContactsNumber extends React.Component {

    componentWillMount () {
        // axios.get('http://localhost:5000/employee/'+ 4, 
        //     {
        //         headers: {
        //             Authorization: 'Bearer ' + localStorage.getItem("header")
        //         }
        //     })
        //     .then(res => {
        //         console.log("res", res.data);
        //     })
    }

    state = {
    }

    handleContact = e => {
        e.preventDefault();

        this.props.form.validateFieldsAndScroll((err, values) => {
            if (!err) {
                console.log(values);

                const contact = {
                    name: values.name || undefined,
                    contact: values.contact || undefined,
                    relation: values.relation || undefined,
                    employee: {emp_id:4} || undefined
                }

                axios.post('http://localhost:5000/contact/add', contact, 
                {
                    headers: {
                        Authorization: 'Bearer ' + localStorage.getItem("header")
                    }
                })
                .then(res => {
                  swal("Yeah!",res.data,"success");
                  console.log("res", res.data)
                })
                .catch(e => {
                  swal("Oops!","Didn't Added!!!","error");
                  console.log("res", e)
                })
              
            }
        })

    }

    render () {

        const { getFieldDecorator } = this.props.form;
        const tailFormItemLayout = {
            wrapperCol: {
              xs: {
                span: 24,
                offset: 0,
              },
              sm: {
                span: 16,
                offset: 8,
              },
            },
        };

        return(
            <div>
                <Card title='Contact Numbers' bordered={false}> 
                 <Form layout="vertical" hideRequiredMark>
            
                    <Form.Item >
                        {getFieldDecorator("name", {
                        rules: [
                            {
                            required: true,
                            message: "Please input your emergancy contact person !"
                            }
                        ]
                        })(<Input
                        id= '1'
                        prefix={<Icon type="user" style={{ color: "rgba(0,0,0,.25)" }} />}
                        placeholder="&nbsp;&nbsp;&nbsp;&nbsp;Name"
                        />)}
                    </Form.Item>

                    <Form.Item >
                        {getFieldDecorator("contact", {
                        rules: [
                            {
                            required: true,
                            message: "Please input your emergancy contact !"
                            }
                        ]
                        })(<Input
                        id= '2'
                        prefix={<Icon type="phone" style={{ color: "rgba(0,0,0,.25)" }} />}
                        placeholder="&nbsp;&nbsp;&nbsp;&nbsp;Contact Number"
                        />)}
                    </Form.Item>

                    <Form.Item >
                        {getFieldDecorator("relation", {
                        rules: [
                            {
                            required: true,
                            message: "Please input relation for emergancy person !"
                            }
                        ]
                        })(<Input
                        id= '3'
                        onBlur={this.handleConfirmBlur}
                        prefix={<Icon type="home" style={{ color: "rgba(0,0,0,.25)" }} />}
                        placeholder="&nbsp;&nbsp;&nbsp;&nbsp;Relation"
                        />)}
                    </Form.Item>
                    <Row>
                        <Col span={17}>  
                        <Form.Item {...tailFormItemLayout}>
                        <Button type="primary" onClick={this.handleContact} style={{width:'100px', float:'right'}}>
                        <Icon type="check-circle" /> 
                            Submit
                        </Button>
                        </Form.Item>
                        </Col> 

                        <Col span={7}> 
                        <Form.Item {...tailFormItemLayout}>
                        <Button type="danger" onClick={this.props.close} style={{width:'100px', float:'left'}}>
                        <Icon type="close-circle" /> 
                            Cancel
                        </Button>
                        </Form.Item>
                        </Col> 
                    </Row>
                </Form>
                </Card>
            </div>
        );
    }
}

const WrappedContactNumber= Form.create({ name: 'register' })(ContactsNumber);

export default WrappedContactNumber;
